import React from "react";
import './SideFashionLayout';

const SideFashionLayout = () =>{
    return(
        <div className="leftsidebox">
            <div className="sidetextbox"></div>
            <div className="sidetextbox2"></div>
            <div className="sidetextbox3"></div>
            <div className="sidetextbox3"></div>
            <div className="sidetextbox3"></div>        
        </div>

    );
}
export default SideFashionLayout
